import React from "react";
import "./home.css"

const HomeComponent = () => {

    return(
        <div className='content'>
            <h1>hi! my name is</h1>
            <h1>KRISTI BUI</h1>
            <p>
                Hi, welcome! My name is Kristi and I am a developer and a fourth-year computer science 
                student at Northeastern University. 
            </p>
        </div>
    )
}

export default HomeComponent;
